results_list = [results_len2_nn_adv_1_meanbaseline, results_len2_nn_adv_lr5_baseline10, results_len2_nn_reinforce_meanbaseline, results_len2_nn_neg_training_threshold10_lr5]
figname_modifier = "len2_nn"


labels = ["Adv. RL ($E_\sigma[r]$ Baseline)", "Adv. RL (Baseline 10)", "REINFORCE ($E_q[r]$ Baseline)", "Neg. Training (Threshold 10)"]

def make_plot(xlabel, ylabel, dictkey, figname):
    plt.clf()
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)


    for i in range(len(labels)):
        dict_list = results_list[i]
        results = []
        for d in dict_list:
            results.append(np.array(d[dictkey][:n_epochs]))

        for x in results:
            print(x.shape)

        to_plot = np.stack(results)
        # print(to_plot.shape)

        last, conf_bound = plot_with_conf_bounds(
            np.array(to_plot),
            x_range,
            label=labels[i],
            color=color_list[i],
            linestyle=linestyle_list[i],
        )

    # plt.legend(loc='upper right', bbox_to_anchor=(1, 0.6), fontsize=7)
    plt.legend()
    plt.savefig(figname)

make_plot(
    xlabel="Policy Updates", ylabel="Average Reward (Standard Sampling (from q))",
    dictkey='rews', figname=f"{figname_modifier}_rewards"
)
make_plot(
    xlabel="Policy Updates", ylabel="Average Reward (SMC Sampling (from $\sigma$))",
    dictkey='adv_rews', figname=f"{figname_modifier}_adv_rewards"
)
make_plot(
    xlabel="Policy Updates", ylabel="Log Total Prob of Bad Words (Analytic Calculation using q)",
    dictkey='log_prob_bad_word', figname=f"{figname_modifier}_log_prob_bad_word"
)

